// src/components/footer/Footer.jsx
import React from 'react';
import styled from 'styled-components';


const FooterContainer = styled.div`
  font-size: 0.8rem;
  background: #000;
  color: #fff;
  //font-weight: bold;
  @media screen and (max-width: 600px) {
    font-size: 1vw;
  }
`;

//공지사항 
const NoticeContainer = styled.div`
  background: #000;
  border-top: solid 1px #d9d9d9;
  border-bottom: solid 1px #d9d9d9;
  color: #838383;

  padding-left: 10vw;
  height: 3vw;
  display: flex;
  align-items: center;
  @media screen and (max-width: 600px) {
    font-size: 1vw;
  }
`;

//하단 전체
const FooterInfoContainer = styled.div`
  background: #fbfafa;
  padding-left: 10vw;


  display: flex;
  flex-direction: column;
  justify-items: center;
  @media screen and (max-width: 600px) {
    font-size: 1vw;
  }
`;

//회사소개...., 서비스 이용약관.. 라인 (추후 링크 걸 수 있는 라인)
const FooterInfoBtnContainer = styled.li`
  display: flex;
  list-style: none;
  margin: 1vw 0;

  li {
    margin-right: 2vw;
  }
  @media screen and (max-width: 600px) {
    font-size: 1vw;
  }
`;


const FooterContactContainer = styled.footer`
  color: #838383;
  margin-bottom: 1vw;
  line-height: 1.5;

  a {
    color: inherit;
    text-decoration: none;
  }

  span {
    margin-right: 0.5vw;
  }

  button {
    margin-top: 1vw;
    margin-right: 1vw;
    margin-bottom: 1vw;
    padding: 0.5vw 0.7vw;

    color: #582fff;
    //font-size: 0.7rem;
    font-weight: bold;

    border: none;
    background: #dad1fb;
    border-radius: 0.3vw;
  }

  @media screen and (max-width: 600px) {
    button {
      margin-top: 1vw;
      margin-right: 1vw;
      margin-bottom: 1vw;
      padding: 0.5vw 1vw;
      font-size: 1vw;
    }
  }
`;

const FooterCompanyInfoContainer = styled.div`
  margin-right: 30vw;
  line-height: 1.5;

  @media screen and (max-width: 600px) {
    font-size: 1vw;
  }
`;

const Footer = () => {
    return (
        <FooterContainer>
            <NoticeContainer>
                <span>공지사항</span><span style={{marginLeft: "2vw"}}>유료 행사 참가자 신청 프로세스 변경 안내</span>
            </NoticeContainer>

            <FooterContactContainer>
              <div>
                <span>HIVe 모집 문의 </span>
                <span> (평일 10:00 ~ 17:00)</span>
              </div>
            <div>
                <span>사업 제휴 문의</span>
                <a  style={{marginLeft: "0.5vw"}} //채팅상담과 수직 맞추기 
                href = 'mailto:www.link-it.com'>www.link-it.com</a>
            </div>
            <div>
                <button>광고센터</button>
                <button>서비스 소개자료</button>
            </div>
            </FooterContactContainer>   

            <FooterCompanyInfoContainer>
                <div style={{fontSize:"1vw", marginBottom: "0.5vw"}}>홍익대학교 벤처창업기관 HIVe</div>
                <div><span>HIVe</span><span>  |    회장 : 주서영</span><span>  |    부회장 : 주은강</span></div>
                <div>서울특별시 마포구 와우산로 94 인문사회관 D동 308호</div>
                <div><span>@hive_hongik</span><span>  |    Tel : 010-4641-5411</span></div>
                <br></br>

                <FooterInfoBtnContainer>
                    <li>서비스 이용 약관</li>
                    <li>개인정보처리방침</li>
                    <li>전자금융거래 이용약관</li>
                    <li>취소 및 환불 약관</li>
                    <li>이메일 주소 무단수집 거부</li>
                </FooterInfoBtnContainer>
                <br></br>
                <div style={{fontSize:"0.7vw", color: "#838383", marginBottom: "1vw"}}>Copyright ⓒ HIVe.   All Rights Reserved</div>
            </FooterCompanyInfoContainer>
        </FooterContainer>
    );
};

export default Footer;
